DROP TABLE IF EXISTS `be_read`;
CREATE TABLE `be_read` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `timestamp` char(14) DEFAULT NULL,
  `aid` char(7) DEFAULT NULL,
  `readNum` bigint DEFAULT NULL,
  `readUidList` text,
  `commentNum` bigint DEFAULT NULL,
  `commentUidList` text,
  `agreeNum` bigint DEFAULT NULL,
  `agreeUidList` text,
  `shareNum` bigint DEFAULT NULL,
  `shareUidList` text,
  PRIMARY KEY (`id`),
  CONSTRAINT `fk_be_read_aid` FOREIGN KEY (`aid`) REFERENCES `article` (`aid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES `be_read` WRITE;
UNLOCK TABLES;


